import { loadDetails } from '../../actions/userActions';
import Detail from '../detail.component/detail.component';
import detailStore from '../../store/store';

function Entry() {
	const [detail, setDetail] = useState([]);
	// useEffect(() => {
	// 	detailStore.addChangeListener(onChange);
	loadDetails();
	// 	return () => {
	// 		return detailStore.removeChangeListener(onChange);
	// 	};
	// }, [detail.length]);

	// function onChange() {
	// 	setDetail(detailStore.getDetail());
	// }
	return (
		<>
			{detail.length !== 0 &&
				detail.map((current) => {
					return <Detail key={current._id} detail={current}></Detail>;
				})}
			{detail.length === 0 && <div>Loading...</div>}
		</>
	);
}

export default Entry;
